import React from 'react'
import {BrowserRouter as Router} from 'react-router-dom';
import Header from './Components/Header'
import Section from './Components/Section'

import './index.css'
export default function App() {
    return (
        <div className = "app">
            <Router>
                <Header / >
                <br/><br/>
                <Section />
            </Router>
        </div>
    )
}
